import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";

const InfoCaballeriza = (props) => {
  return (
    <Container>
      <Col className="col d-flex justify-content-center">
        <Card className="w-50 mb-3 align-self-center">
          <Card.Header>
            <h5>{`Nro. ${props.numero}`}</h5>
          </Card.Header>
          <Card.Body>
            <h6>{`Entrenador: ${props.entrenador}`}</h6>
            <h6>{`Veterinario: ${props.veterinario}`}</h6>
            <h6>{`Total: ${props.total}`}</h6>
            <h6>{`Disponibles: ${props.disponible}`}</h6>
          </Card.Body>
        </Card>
      </Col>
    </Container>
  );
};

export default InfoCaballeriza;
